.
Esta receta me dio siempre curiosidad al llevar en su masa ricota. Originalmente llevaba frutillas, pero como efecto del aislamiento tenía manzanas. Después de comerla y descubrir que es riquísima, pense que le quedaría muy bien unos arandanos (150 gr). 
. 
Ingredientes:
- 250 gr de ricota
- 250 gr de harina leudante.
- 100 gr de manteca.
- 1 cucharadita de vainilla
- 1 cucharadita de jugo limón ( le puse limoncello, por falta de 🍋) 
- 220 gr de azúcar
- 3 huevos 
Primero precalentar horno a 180°c. Enmantecar molde y guardarlo en la heladera. Con un batidor, realizar el cremado de la manteca, el azúcar y colocar la vainilla. Agregar la ricota, huevos y jugo de 🍋, batir. Tamizar la harina y mezclar bien todo para no tener grumos. Poner en el molde y encima las laminas de manzanas (o los arandanos). Llevar al horno por 50 min o hasta que veas cocida la torta.
.
