Sobre el Origen No existe un registro que defina cuál es el verdadero origen del Cachito de Jamón. La versión más difundida es la del hecho de que fue producto de la invención de inmigrantes portugueses en la Venezuela de principios del siglo XX, cuando el país suramericano era uno de los principales puntos de llegada para españoles, portugueses e italiano.
